import base64
from io import BytesIO
from PIL import Image

# Reemplaza esto con la cadena base64 de tu imagen
base64_string = ''

# Decodifica la cadena base64
imagen_decodificada = base64.b64decode(base64_string)

# Crea una imagen desde los bytes decodificados
imagen = Image.open(BytesIO(imagen_decodificada))
imagen.show()
